import React from 'react';
import styles from './Header.module.css';
import nailHero from '../../Components/images/nail-hero.jpg'; // Imagen del héroe

const Header: React.FC = () => {
  return (
    <header className={styles.header}>
      {/* Barra de navegación */}
      <nav className={styles.nav}>
        <ul className={styles.navList}>
          <li><a href="#">About</a></li>
          <li><a href="#">Pages</a></li>
          <li><a href="#">Gallery</a></li>
          <li><a href="#">Menu</a></li>
          <li><a href="#">Booking</a></li>
          <li><a href="#">Contacts</a></li>
        </ul>
      </nav>

      {/* Sección hero */}
      <div className={styles.hero} style={{ backgroundImage: `url(${nailHero})` }}>
        <h1 className={styles.heroText}>Be Shiny. Be Beautiful</h1>
        <p className={styles.heroSubtext}>Extravagant, Friendly Nail Service at an Affordable Price</p>
        <button className={styles.ctaButton}>Services & Prices</button>
      </div>
    </header>
  );
};

export default Header;
